import PointsOfTable from './data-splan';

const DataTable = (datas)=> {
    return (
        <ul>
        <li><PointsOfTable label={datas[0].label} important ={datas[0].important} /></li>
        <li><PointsOfTable label={datas[1].label} important ={datas[1].important} /></li>
        <li><PointsOfTable label={datas[2].label} important ={datas[2].important} /></li>

        </ul>
    );
};
export default DataTable;
